import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import IconButton from '@mui/material/IconButton';
import './header.css'; // Import the CSS file

const BaseHeader = ({ onHomeClick, children, additionalButton }) => {
  const handleHomeClick = () => {
    if (onHomeClick) {
      onHomeClick();
    } else {
      // Default behavior if onHomeClick is not provided
    }
  };

  return (
    <Box className="header-box">
      <AppBar position="static" className="header-appbar">
        <Toolbar>
          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            className="header-iconbutton"
          >
            {children}
          </IconButton>
          <Typography variant="h6" component="div" className="header-typography">
            <IconButton
              aria-label="vkc-global"
              onClick={handleHomeClick}
              className="header-logo"
            >
              <img src="/logo.jpeg" alt="VKC" className="header-logo" />
            </IconButton>
          </Typography>
          {additionalButton}
        </Toolbar>
      </AppBar>
    </Box>
  );
};

export default BaseHeader;
